import './App.css';
import { Routes, Route } from 'react-router-dom';
import { Page } from './components/Page';
import { Container } from "@mui/material";
import Nav from "./components/navigation/Nav";
import {useEffect} from "react";
import axios from 'axios';

function App() {

    const baseURL = "http://localhost:3030"

    async function adViewedEvent() {
        window.googletag.cmd.push(function() {
            window.googletag.pubads().addEventListener('impressionViewable', async function(e) {
                // Send event;
                let data = {
                    type: "Ad slot viewed",
                    slot_id: e.slot.getSlotElementId(),
                    timestamp: Date.now()
                }
                const res = await axios.post(`${baseURL}/events`, data)
                console.log("Ad viewed, res:", res);
                return res;
            });
        });
    }

    async function adClickedEvent(e) {
        e.preventDefault();
        e.currentTarget.submit();
    }
    async function pageLoadEvent() {
        const res = await axios.post(`${baseURL}/events`, {
            type: "Page load",
            timestamp: Date.now()
        })
        return res;
    }

    useEffect(() => {
        if (document.readyState === 'complete') {
            pageLoadEvent().then(r => console.debug(r));
        } else {
            window.addEventListener('load', pageLoadEvent);
            return () => window.removeEventListener('load', pageLoadEvent);
        }
    }, [])

    useEffect(() => {
        adViewedEvent().then(res => res); // Ad viewed
    }, [])

  return (
    <div className="App">
        <Nav />
        <Container fixed sx={{
            backgroundColor: '#fafafa',
            margin: '1% auto',
            padding: '3%',
            border: '1px solid rgba(0,0,0,0.1)'
        }}>
                <Routes>
                    <Route path="*" element={<Page number={1} />} />
                    <Route path="two" element={<Page number={2} />} />
                    <Route path="three" element={<Page number={3} />} />
                    <Route path="four" element={<Page number={4} />} />
                </Routes>
        </Container>
    </div>
  );
}

export default App;
